<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>3x3 Layout with Images</title>
    <style>
        .container {
            width: 600px;   /* Width of the entire container */
            height: 600px;  /* Height of the entire container */
            margin: 0 auto; /* Center the container horizontally */
            position: relative;
        }

        .row {
            width: 100%;       /* Row takes full width of the container */
            height: 33.33%;    /* Row takes 1/3 of the height */
            display: block;    /* Stack the rows vertically */
        }

        .cell {
            width: 33.33%;    /* Each cell takes 1/3 of the row's width */
            height: 100%;     /* Cell fills the entire height of the row */
            float: left;      /* Position the cells side by side */
            border: 1px solid black;  /* Border for each cell */
            box-sizing: border-box;
            overflow: hidden; /* Prevent content overflow */
        }

        .cell img {
            width: 100%;      /* Make the image fill the entire cell width */
            height: 100%;     /* Make the image fill the entire cell height */
            object-fit: cover; /* Ensures the image covers the cell without distorting */
        }
    </style>
</head>
